    "Use Onboarding to introduce learners to proctoring, verify their identity, and create an onboarding profile. Learners must complete the onboarding profile step prior to taking a proctored exam. Profile reviews take 2+ business days.": "Use Integra\u00e7\u00e3o/Onboarding para introduzir aos estudantes o processo de Supervis\u00e3o de Avalia\u00e7\u00e3o, verifique as suas identidades e crie um perfil de boas-vindas. Os estudantes devem completar o seu perfil antes de fazer o exame vigiado. As revis\u00f5es de perfil demoram mais de 2 dias \u00fateis.",
