    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "Utilize um exame cronometrado para limitar o tempo dos estudantes em cada problema desta subsec\u00e7\u00e3o. Os estudantes devem submeter as respostas antes de expirar o tempo. Pode conceder tempo adicional para estudantes individuais por meio do painel do formador.",
    "Use as a Prerequisite": "Utilizar como Pr\u00e9-requisito",
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, click \"Bookmark this page\" under the page title.": "Utilize os favoritos para o ajudar a regressar mais facilmente \u00e0s p\u00e1ginas do material did\u00e1tico. Para marcar uma p\u00e1gina, clique em \"Marcar esta p\u00e1gina\" por baixo do t\u00edtulo da p\u00e1gina.",
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "Use sub-comunidades como base para dividir os debates. Todos os estudantes, independentemente do conjunto, v\u00eaem os mesmos t\u00f3picos de debate mas, dentro de t\u00f3picos divididos, apenas os elementos da mesma sub-comunidade v\u00eaem e respondem \u00e0s publica\u00e7\u00f5es dos outros.",
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "Use os modos de inscri\u00e7\u00e3o como base para dividir os debates. Todos os estudantes, independentemente do seu modo de inscri\u00e7\u00e3o, veem os mesmos t\u00f3picos de debate mas, dentro de t\u00f3picos divididos, apenas os estudantes que est\u00e3o no mesmo modo veem e respondem \u00e0s publica\u00e7\u00f5es dos outros.",
    "Use my institution/campus credentials": "Utilize as minhas credenciais da institui\u00e7\u00e3o/campus",
    "Use the All Topics menu to find specific topics.": "Utilize a lista \"Todos os T\u00f3picos\" para localizar t\u00f3picos espec\u00edficos.",
    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "Utilize a sua webcam para tirar uma fotografia do seu rosto. N\u00f3s combinaremos esta fotografia com a fotografia do seu Documento de Identifica\u00e7\u00e3o.",
