    "You can pay now even if you don't have the following items available, but you will need to have these to qualify to earn a Verified Certificate.": "Poder\u00e1 pagar agora mesmo que n\u00e3o tenha os seguintes itens dispon\u00edveis. Contudo, precisar\u00e1 de os ter para se poder habilitar a ganhar um certificado validado.",
